import React, { Component } from 'react'
import "../../Css/Profile.css";

import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import { getIndividualProfile } from '../../actions/profileAction.js';
import Experience from './Experience';
import Education from './Education';
import Profile from './Profile';
import Spinner from '../../Spinner.js'


 class ProfileData extends Component {

    render() {
        const { individualProfile, loading} = this.props.profile; 

            let Profile;

    if (individualProfile === null || loading) {
      Profile = <h2>User Has No profile</h2>;
    } else {
      Profile = <Profile />
    }
          
        return (
             <div>
                {Profile}
                {/* {userExperience}
                {userEducation} */}
            </div>
        )
    }
}


ProfileData.propTypes = {
  getCurrentProfile: PropTypes.func.isRequired,
  profile: PropTypes.object.isRequired,
};

const mapStateToProps = (state) => ({
  profile: state.profile,
});
export default connect(mapStateToProps, {  getIndividualProfile })(ProfileData);
